import React from "react";
import {Button} from "reactstrap";

const range = len => {
  const arr = [];
  for (let i = 0; i < len; i++) {
    arr.push(i);
  }
  return arr;
};

const newTransfer = (transfer) => {
  return {
    reference: transfer.reference,
    executionDate: transfer.executionDate,
    principalAccount: transfer.principalAccount,
    beneficiaryAccount: transfer.beneficiaryAccount,
    totalAmount: m,
    stateAction: act
  };
};

export function makeData(transfers) {
  return range(transfers.length).map(transfer => {
    return {
      ...newTransfer(transfer),
      children: range(10).map(newTransfer)
    };
  });
}
